import { types } from 'node:util'
import React from 'react'

const Login = () => {

    const handleSubmit = (data) => {
        console.log(data)
    }


    return (
        <div>
            Login Page
            <form onSubmit={handleSubmit}>
                <label>Email</label>
                <input type="text" name="email" />
                <br/>
                <label>Password</label>
                <input type="password" name="password" />
                <input type="submit"/>
            </form>
        </div>
    )
}

export default Login;
